import React from "react";
import Todo from "./Todo";
import { FaBeer } from "react-icons/fa";
const TodoList = ({ todos, setTodos }) => {
  return (
    <div>
      {todos.map((todo) => {
        return (
          <li key={todo.id}>
            <Todo todo={todo} />
          </li>
        );
      })}
      <div>
        <button></button>
      </div>
    </div>
  );
};

export default TodoList;
